import React, { useEffect, Component } from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";
import CustomTable from "../../components/custom-table/custom-table.component";
import { fetchOrdersFromFirestoreStart } from "../../redux/admin/admin.actions";

import { selectOrders } from "../../redux/admin/admin.selectors";

const AdminPage = ({ fetchOrdersFromFirestoreStart, orders }) => {
  useEffect(() => {
    fetchOrdersFromFirestoreStart();
  }, []);
  return (
    <div>
      <h1>Admin Page</h1>
      <CustomTable />
      {orders.map((order) => (
        <h1>{console.log(order)}</h1>
      ))}
    </div>
  );
};

const mapStateToProps = createStructuredSelector({
  orders: selectOrders,
});

const mapDispatchToProps = (dispatch) => ({
  fetchOrdersFromFirestoreStart: () =>
    dispatch(fetchOrdersFromFirestoreStart()),
});

export default connect(mapStateToProps, mapDispatchToProps)(AdminPage);
